const Card = () => {
    return (
        <div className="card">
            <img src='https://robohash.org/mia?200*200
            ' className="card-img-top" alt="">
            </img>
            <div className="card-body">
                <h5 className="card-title">Jane Doe</h5>
                <p className="card-text">jane.doe@gmail.com</p>
            </div>
        </div>

    );
}

export default Card;
